import './App.css';
import React, { useEffect, useState} from 'react';

function App() {
  const [data, setData] = useState(null);

  useEffect(() => {
    fetch('http://localhost:5000/getData')
      .then((response )=>{
        response.json().then(data => {
          setData(data);
          console.log(data);
        });
      })}
  , []);


  return (
    <div className="App">
     <p></p>
    </div>
  );
}

export default App;
